import React from 'react';
import "./navBar.css";
const navBar=()=>{
    return (
        <div className='container'>
            div
            <ul className='links'>
                <li><a href='#'>Our solutions</a></li>
                <li><a href='#'>Contact</a></li>
                <li><a href='#'>Feedbacks</a></li>
            </ul>
            <button>Get Started</button>
        </div>
    );
}
export default navBar;
